import React from 'react';

const Card = ({ children, className = '', ...props }) => {
  return (
    <div 
      className={`bg-card text-card-foreground rounded-lg border shadow-sm ${className}`} 
      {...props}
    >
      {children}
    </div>
  );
};

export default Card;
